const Movie = ["Goodfellas", "Beauty and the Beast"]




export default function MovieList() {
    const movieListMovies = MovieList.split("")
    return (
        <div>
            {movieListMovies.map(Movie => <div>{Movie}</div>)}
        </div>
    )
}
